import React from "react";
import "./Header.css";
import logo from "../logo.svg";
function header() {
  return (
    <>
      <div className="header">
        <div className="logo">
          <img src="logo192.png" />
          <span>SecureNet</span>
        </div>
      </div>
    </>
  );
}

export default header;
